import './Footer.scss';
import React from 'react';
import NavButton from '../layout/button/NavButton';

const Footer= () => {
    return (
        <footer className='footer'>
            <li>Contact us</li>
            <li>Terms of Use</li>
            <li>Privacy Policy</li>
            <NavButton content={'Contact us'} component={'/AllChefs'}></NavButton>
            <NavButton content={'Terms of Use'} component={'/AllRestaurants'}></NavButton>
            <NavButton content={'Privacy Policy'} component={'/Privacy Policy'}></NavButton>
        </footer>
    )
}

export default Footer;
